base_url = 'http://books.toscrape.com/'
current_book_url = (
    'https://books.toscrape.com/catalogue/a-light-in-the-attic_1000/index.html'
)
category_url = (
    'http://books.toscrape.com/catalogue/category/books/travel_2/index.html'
)


class SoupFromFiles:
    def __init__(self):
        self.base_response = requests.get(base_url)
        self.book_page_response = requests.get(current_book_url)
        self.category_response = requests.get(category_url)

    def files_creator(self):
        base_website_contents = self.base_response.text
        book_page_contents = self.book_page_response.text
        current_category_content = self.category_response.text
        curr_path = os.getcwd() + '/tests'

        with open(curr_path + '/Bookswebpage.html', 'w') as base:
            base.write(base_website_contents.encode("latin-1"))
        with open(curr_path + '/Bookpage.html', 'w') as book_content:
            book_content.write(book_page_contents.encode("latin-1"))
        with open(curr_path + '/CurrentCategoryWebpage.html', 'w') as category_content:
            category_content.write(current_category_content.encode("latin-1"))

    def create_soup(self, type_of_soup):
        if type_of_soup == 'book':
            soup = BeautifulSoup(self.book_page_response.text.encode("latin-1"), "lxml")
            return soup
        if type_of_soup == 'page':
            soup = BeautifulSoup(self.base_response.text.encode("latin-1"), "lxml")
            return soup
        if type_of_soup == 'category':
            soup = BeautifulSoup(self.category_response.text.encode("latin-1"), "lxml")
            return soup

    @staticmethod
    def open_and_parse_files_to_make_soup(filename):
        current_file_path = os.getcwd()
        if 'tests' not in current_file_path:
            current_file_path = os.getcwd() + '/tests'

        file_to_open = open(current_file_path + filename, 'r')
        file_to_parse = BeautifulSoup(file_to_open.read(), 'lxml')
        file_to_open.close()

        return file_to_parse


